function getRandomCoordinates(center, radius) {
    const y0 = center[0];
    const x0 = center[1];
    const rd = radius / 111300;

    const u = Math.random();
    const v = Math.random();

    const w = rd * Math.sqrt(u);
    const t = 2 * Math.PI * v;
    const x = w * Math.cos(t);
    const y = w * Math.sin(t);

    return [y + y0, x + x0];
}

function selectCar(carId) {
    document.getElementById(`car-${carId}`).checked = true;
}

function validateStep(stepNumber) {
    let isValid = true;

    if(stepNumber === 1) {
        const car = document.querySelector('input[name="car"]:checked');
        const rentalPeriod = document.getElementById('rentalPeriod').value;

        if(!car || !rentalPeriod) {
            isValid = false;
            alert('Пожалуйста, выберите автомобиль и период аренды');
        }
    }
    else if(stepNumber === 3) {
        const name = document.getElementById('fullName').value;
        const phone = document.getElementById('phone').value;
        const email = document.getElementById('email').value;
        const license = document.getElementById('driverLicense').value;

        if(!name || !phone || !email || !license) {
            isValid = false;
            alert('Пожалуйста, заполните все обязательные поля.');
        }

        if(email && !/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email)) {
            isValid = false;
            alert('Пожалуйста, введите корректный email адрес.');
        }

        if(license && !/^[0-9]{10}$/.test(license.replace(/\s/g, ''))) {
            isValid = false;
            alert('Пожалуйста, введите корректный номер водительского удостоверения (10 цифр).');
        }
    }

    return isValid;
}
